var json_out = {};
const ports = 8;

// Los estados del dispositvo cada puerto pueden ser 0, 1, 2, 3
// que significan
const statuses = [
    "Not connected",
    "Preoperate",
    "Operate",
    "Communication Error",
];

for (let i = 1; i <= ports; i++) {
    if (msg.payload.data[`/iolinkmaster/port[${i}]/iolinkdevice/status`].data === 2) {
        json_out[`port${i}`] = {
            status: statuses[msg.payload.data[`/iolinkmaster/port[${i}]/iolinkdevice/status`].data],
            serial: msg.payload.data[`/iolinkmaster/port[${i}]/iolinkdevice/serial`].data,
            productname: msg.payload.data[`/iolinkmaster/port[${i}]/iolinkdevice/productname`].data,
            data: msg.payload.data[`/iolinkmaster/port[${i}]/iolinkdevice/pdin`].data,
        };
    } else {
        json_out[`port${i}`] = {
            status: statuses[msg.payload.data[`/iolinkmaster/port[${i}]/iolinkdevice/status`].data],
        };
    }
}

msg.payload = json_out;
return msg;

